export function productslist() {
  return {
    type: "PRODUCTS_LIST",
    payload: [
      { id: "1", name: "adidas" },
      { id: "2", name: "nike" },
      { id: "3", name: "puma" },
    ],
  };
}

export function userslist() {
  return {
    type: "USERS_LIST",
    payload: [
      { id: "1", name: "afrosiyob" },
      { id: "2", name: "mardon " },
      { id: "3", name: "charos" },
    ],
  };
}
